import Typewriter from 'typewriter-effect';

function Search() {

    return (
        <div>
            <input 
                type="text"
                placeholder={
                    <Typewriter
                        onInit={(typewriter) => {
                            typewriter.typeString('Search for City')
                            .pauseFor(2500)
                            .deleteAll()
                            .start();
                        }}
                    />
                }
            />
        </div>
    )
}

export default Search;
